import React, { Component } from "react";
import "../css/Homepage.css";

class Homepage extends Component {
    constructor (props) {
        super(props);
        this.state = {

        }
    }


    render() {
      return (
        <div className="home">
            <div className="component-container"> 
                <div id="home-component" class="grid">
                    <profile>
                        <div className="profile-pic">
                        </div>
                    </profile>
                    <performances>
                        <div className="profile-pic">
                        </div>
                    </performances>
                    <hobbies>
                        <div className="profile-pic">
                        </div>
                    </hobbies>
                    <contacts>
                        <div className="profile-pic">
                        </div>
                    </contacts>
                    <music>
                        <div className="profile-pic">
                        </div>
                    </music>
                    <nameplate>
                        <div className="profile-pic">
                            <div style={{fontSize: "1.5rem", justifyContent: "center", display: "block"}}> Anita Kuo</div>
                        </div>
                    </nameplate>
                </div>
            </div>
        </div>
      );
    }
}

export default Homepage;
